Que obsesion con los descredito alas mujeres y la exaltacion de  machos alfas tienen ustedes.

@MariaGoikoetxea Me alegro mucho. Cuentas con todo mi apoyo, para lo que necesites.
Has demostrado tu enorme capacidad de trabajo, de direccion-coordinacion, de gestion, de llegar a acuerdos y  afrontar disensos ademas, aportar alegria e ilusion por un proyecto transformador.
